import React from 'react'
import AddIcon from '@material-ui/icons/Add';

function FormArea() {
    const [note, setNote] =useState({
        title:"",
        content:""
    })
    console.log(note);

    return (
        <Paper style={{margin:"10px 10%", padding:"25px 50px"}}>
            <form>
                <TextField label="Title" fullWidth autoComplete="off" />
                <TextField label="Content" fullWidth autoComplete="off" multiline rows={4} />
                
            </form>
            <Fab style={{marginTop:"20px", background:"lightblue"}}><AddIcon/></Fab>
        </Paper>
    )
}

export default FormArea
